/*-- datePicker */


$(function() {
    
    $.datetimepicker.setLocale('ru');
    //dateTimePicker
    
    if( document.documentElement.clientWidth > 768 ){
        $('#datetimepicker,#datetimepickerSkype,#datetimepickerPhone,#datetimepickerBreakFast').datetimepicker({
            onGenerate:function( ct ){
                jQuery(this).find('.xdsoft_date.xdsoft_weekend')
                  .addClass('xdsoft_disabled');
            },
            lang: 'ru',
            format: 'd.m.Y H:i',
            minDate: 0,
            dayOfWeekStart: 1,
            allowTimes: ['09:00','10:00','11:00','12:00','13:00','14:00','15:00','16:00','17:00','18:00','19:00','20:00']
        });
    }
    

	// плавный скролл
	$(".needScroll").mPageScroll2id({
    scrollSpeed: 700,
    offset: "80"
	});

	// менять змею на стрелки влево
  $(".methodology .right .owl-prev").on("click",function(){

    var activeIdLeft = $(".methodology .items .title.active").data("number") - 1;
		if(activeIdLeft == 0){
			activeIdLeft = 7;
    }
    var newPath = $(".methodology .left .item.numb" + activeIdLeft).find(".hidden img").attr("src");
    $(".methodology .snakeWrap img").attr("src", newPath);
    $(".methodology .left .item .title").removeClass("active");
    $(".methodology .left .item.numb" + activeIdLeft + " .title").addClass("active");

    $(".tab-item2").hide();
    $(".tab-item2.tab" + activeIdLeft).fadeIn();

  });

  // менять змею на стрелки вправо
  $(".methodology .right .owl-next").on("click",function(){

    var activeIdRight = $(".methodology .items .title.active").data("number");
		activeIdRight++;
    if(activeIdRight == 8){
      activeIdRight = 1;
    }
    var newPath = $(".methodology .left .item.numb" + activeIdRight).find(".hidden img").attr("src");
    $(".methodology .snakeWrap img").attr("src", newPath);
    $(".methodology .left .item .title").removeClass("active");
    $(".methodology .left .item.numb" + activeIdRight + " .title").addClass("active");

    $(".tab-item2").hide();
    $(".tab-item2.tab" + activeIdRight).fadeIn();

  });

	// закрыть выбор связи по клику вне области
	$(".dropDown").click(function(e){
    e.stopPropagation();
  });
  
  $(document).click(function(){
    $(".dropDown").slideUp().closest(".doubleBtns").removeClass("on");
  });

	// кнопка наверх
	$('.topBtn').click(function() {
		$('html, body').stop().animate({scrollTop: 0}, 'slow', 'swing');
	});
	$(window).scroll(function() {
		if ($(this).scrollTop() > $(window).height()) {
			$('.topBtn').addClass("active");
		} else {
			$('.topBtn').removeClass("active");
		};
	});

	// owlcarousel для classicStudio
	$('.classicStudio .owl-carousel').owlCarousel({
		loop: true,
		autoplay: true,
  	autoplayTimeout: 5000,
  	autoplayHoverPause: true,
		nav: true,
		dots: false,
		smartSpeed: 600,
		navText: ['<i class="fa fa-angle-left"></i>','<i class="fa fa-angle-right"></i>'],
		items: 1
	});

	// табы
    $(".tab-item2").not(":first").hide();
    $(".wrapper-tab .title,.wrapper-tab .link").click(function() {
        $(".wrapper-tab .title").removeClass("active");
        $(this).closest(".item").find(".title").addClass("active");
        $(".tab-item2").hide();
        $(".tab-item2." + $(this).closest(".item").find(".title").attr("id")).fadeIn();
    });

	// методология менять активную картинку
	$(".methodology .title,.methodology .link").on("click",function(){
		$(".methodology .snakeWrap img").attr("src",$(this).closest(".item").find(".hidden img").attr("src"));
	});

  // animation border
	$(".concept .numb1").waypoint(function() {
		$(".concept .numb1 .borderBlock").addClass("goAnim");
		this.destroy();
	}, {
		offset : "75%"

	});

	$(".concept .numb2").waypoint(function() {
		$(".concept .numb2 .borderBlock").addClass("goAnim");
		this.destroy();
	}, {
		offset : "75%"
	});

	$(".concept .numb3").waypoint(function() {
		$(".concept .numb3 .borderBlock").addClass("goAnim");
		this.destroy();
	}, {
		offset : "75%"
	});

	$(".concept .numb4").waypoint(function() {
		$(".concept .numb4 .borderBlock").addClass("goAnim");
		this.destroy();
	}, {
		offset : "75%"
	});

	$(".price .borderBlock").waypoint(function() {
		$(".price .borderBlock").addClass("goAnim");
		this.destroy();
	}, {
		offset : "75%"
	});

	$(".brands .borderBlock").waypoint(function() {
		$(".brands .borderBlock").addClass("goAnim");
		this.destroy();
	}, {
		offset : "75%"
	});

	$(".special .borderBlock").waypoint(function() {
		$(".special .borderBlock").addClass("goAnim");
		this.destroy();
	}, {
		offset : "75%"
	});


	// init scrollr
	if( document.documentElement.clientWidth > 768 )
	{
 		setTimeout(function(){
 			skrollr.init({forceHeight: false});
 		}, 1000);
	}

// 	// owl carousel для methodology
// 	$('.methodology .owl-carousel').owlCarousel({
// 			nav: true,
// 			dots: false,
// 			smartSpeed: 600,
// 			navText: ['<i class="fa fa-angle-left"></i>','<i class="fa fa-angle-right"></i>'],
// 			items: 2
// 	});

	// owl carousel для reviews
	$('.reviews .owl-carousel').owlCarousel({
			nav: true,
			dots: false,
			smartSpeed: 600,
			navText: "",
			items: 1
	});
  
	

	// add active
	$(".concept .item .content .more").on("click",function(){
		$(this).closest(".content").toggleClass("active");
	});

	//owl-carousel для решений
	$('.solutions .owl-carousel').owlCarousel({
			loop: true,
			nav: true,
			dots: false,
			smartSpeed: 600,
			navText: ['<i class="fa fa-angle-left"></i>','<i class="fa fa-angle-right"></i>'],
			items: 1
	});
		
	if( document.documentElement.clientWidth <= 767 ){


		$('.methodology .left .owl-carousel').owlCarousel({
			loop: false,
			nav: true,
			dots: false,
			smartSpeed: 600,
			navText: ['<i class="fa fa-angle-left"></i>','<i class="fa fa-angle-right"></i>'],
			items: 2
		});
	}
	

	// выбор связи toggle
	$(".myHeader .btn").on("click",function(){
		$(this).closest(".doubleBtns").toggleClass("on").closest(".doubleBtns").find(".dropDown").slideToggle();
		return false;
	});

	// меню тугл mobile
	$(".toggle-mnu").click(function(){
		$(this).toggleClass("on");
		$(".menu ul").slideToggle();
		return false;
	});

	// зафиксировать меню
	var topLine = $(".topLine");
	$(window).bind('scroll', function(e){
		if($(window).scrollTop() > 0){
			if(!topLine.hasClass('scrollClass')){
				topLine.addClass('scrollClass');
			}
		}else{
			if(topLine.hasClass('scrollClass')){
				topLine.removeClass('scrollClass');
			}
		}
	});

	// popup form
 	$(".popup").magnificPopup({
		type:"inline",
		mainClass: 'mfp-fade',
		removalDelay: 300
	});

	// gallery
	$('.gallery').each(function() { // the containers for all your galleries
    $(this).magnificPopup({
        delegate: 'a', // the selector for gallery item
        type: 'image',
        mainClass: 'mfp-fade',
				removalDelay: 300,
				fixedContentPos: false,
        gallery: {
          enabled:true
        }
    });
	});

	// табы
	$(".tab-item").not(":first").hide();
	$(".solutions .tab").click(function() {
		$(".solutions .tab").removeClass("active");
		$(this).addClass("active");
		$(".tab-item").hide();
		$(".tab-item." + $(this).attr("id")).fadeIn();
	});

	//bgVideo
	if( document.documentElement.clientWidth > 768 ){
        $("#bgndVideo").YTPlayer();
        $("#bgndVideo").YTPApplyFilters({
       		brightness: 40,
    		});
    }

});

//скрыть прелоадер
$(window).on("load",function(){
		$(".preloader").fadeOut("slow")}
);
